import Video from './demo_vids/aggressive.mp4';
import Poster from './demo_vids/aggressive.png';
import Img from './images/aggressive.png';
export const aggressive = {
    lightBg: false,
    lightText: true,
    lightTextDesc: true,
    headline: 'Aggressive Behaviour Detection',
    description:
      'This particular feature was suggested by the hospital administration. Public places are usually busy due to which there is a chance of fights, aggressions various times. For this, our product detects particular aggressive behaviors. Once such a behavior is detected, appropriate notification alert would be generated.',
    imgStart: '',
    img: Img,
    alt: 'Credit Card',
    path: Video,
    poster: Poster
  };
